import React from 'react';
import axios from 'axios';
import './Logout.css';
import Header from './Header'
const Logout = () => {
    const submit = () =>{
        const logout = axios.create({
            withCredentials: true
        })
        logout.post('http://localhost:8001/api/logout').then(res => res.data)
    }

    
    return (
        <div>
            <Header />
            <section className="lo-container">
                <h1>You have Reached the User page please use these links to navigate the website!</h1>
                <ul>
                    <li><a href='/Home'>HomePage</a></li>
                    <li><a href='/About'>About Our Business</a></li>
                    <li><a href='/Coupons'> Share your Coupons</a></li>
                    <li><a></a></li>
                </ul>
                <button name='btn' onClick={submit}>Logout</button>
            </section>
             
        </div>
    )
}

export default Logout
